// import { GetJSON } from "../common/getjson";

class Home extends Component {
  state = {
    movies: { page: "", result: [], total_pages: "", total_results: "" },
  };

  async componentDidMount() {
    const { data: movies } = await axios.get(TagNames.getURL());
    // with fetchAPI -     const data = GetJSON(url);
    // console.log("URL: " + url);
    console.log(movies);
    this.setState({ movies });
  }

  render() {
    return (
      <>
        <h1>Home</h1>
        {/* <MoviesList /> */}
      </>
    );
  }
}

export default Home;
